const ScreenShot = ({src, alt, caption}) => {
    console.log(`rendering screenShot in ScreenShot ${src}`);
    return (
        <div className="screen-shot">
            <p>screenshot</p>
            <img
                src={src}
                alt={alt}
            />
            <p>{caption}</p>
        </div>
    )
};

export default ScreenShot;
